import React, { useState, useEffect } from 'react';
import 'ol/ol.css';
import { IMapProps, IMapState } from '../types/types';
import { MapUtils } from '../utils/MapUtils';
import { proxyUrls } from '../utils/MapConfig';
import GeoJSON from 'ol/format/GeoJSON';
import VectorSource from 'ol/source/Vector';

const Basemap = (props: IMapProps) => {
    //@ts-ignore
    const [map, setMap] = useState<IMapState>(null);

    const { id, mapContainer } = props

    useEffect(() => {
        const basemap = MapUtils.createMap(mapContainer);
        setMap(basemap);
        MapUtils.getGeojson(proxyUrls[0])
        .then(data => data)
        .then(featureCollection => featureCollection.jsonb_build_object)
        .then(features => { return new GeoJSON().readFeatures(features) })
        .then(geojson => {return new VectorSource({
            format: new GeoJSON(),
            features: geojson
        })})
        .then(data => console.log(data))
    }, []);

    return (
        <>
            <div id={id} className='map'></div>
        </>
    )
}

export default Basemap;
